                        </SView>
                        <SHr height={20} />
                    </SView>
                </SScrollView2 >
            </SView>
        );
    }

    render() {
        return (
            <SPage title={''} hidden disableScroll >
                <SView col={"xs-12"} center height backgroundColor={'transparent'}>
                    <SView col={"xs-11"} flex backgroundColor={'transparent'}>
                        <SHr height={20} />
                        {this.getHeader()}
                        <SHr height={20} />
                        {this.getList()}
                        <SHr height={20} />
                    </SView>
                    <MenuChat url={"chats"} />
